import axiosClient from './axiosClient';

const END_POINT = {
    PRODUCTS: "Products",
    KHOAS: "Khoa"
}

export const getProductAPI = () => {
    return axiosClient.get(`https://localhost:44314/api/${END_POINT.SINHVIENS}`);
}
